  <h2 style="

  <script>
    const parties = [
      { id: 'party1', name: '더불어민주당', base: '#3546b5', levels: [] },
      { id: 'party2', name: '국민의힘', base: '#E61E2B', levels: [] },
      { id: 'party3', name: '개혁신당', base: '#FF7210', levels: [] },
      { id: 'party4', name: '진보당', base: '#d60072', levels: [] },
      { id: 'party5', name: '정의당', base: '#f6b93b', levels: [] },
      { id: 'party6', name: '녹색당', base: '#22AC38', levels: [] },
      { id: 'party7', name: '새미래민주당', base: '#59afb5', levels: [] },
      { id: 'party8', name: '기본소득당', base: '#00D2C3', levels: [] },
      { id: 'party9', name: '조국혁신당', base: '#2188bf', levels: [] },
      { id: 'party10', name: '자유통일당', base: '#4371a3', levels: [] },
    ];
  
    function generateShades(baseColor, options = {}) {
  const {
    hueShift = 0,
    saturationAdjust = 0,
  } = options;

  const shades = [];
  const hsl = rgbToHsl(hexToRgb(baseColor));
  const baseHue = (hsl.h + hueShift) % 360;
  const baseSaturation = clamp(hsl.s + saturationAdjust, 0, 100);

  const lightnessValues = [10, 15, 30, hsl.l, 70, 90]; // dark → base → light

  for (let l of lightnessValues) {
    shades.push(hslToHex(baseHue, baseSaturation, l));
  }

  return shades;
}


function lerp(a, b, t) {
  return a + (b - a) * t;
}

function easeOut(t) {
  return 1 - Math.pow(1 - t, 2);
}

function easeIn(t) {
  return t * t;
}

function clamp(value, min, max) {
  return Math.min(Math.max(value, min), max);
}

// (hexToRgb, rgbToHsl, hslToHex) remain unchanged from your original

  
    function hexToRgb(hex) {
      const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
      return result ? {
        r: parseInt(result[1], 16),
        g: parseInt(result[2], 16),
        b: parseInt(result[3], 16)
      } : null;
    }
  
    function rgbToHsl(rgb) {
      let r = rgb.r / 255, g = rgb.g / 255, b = rgb.b / 255;
      const max = Math.max(r, g, b), min = Math.min(r, g, b);
      let h, s, l = (max + min) / 2;
      if (max === min) { h = s = 0; }
      else {
        const d = max - min;
        s = l > 0.5 ? d / (2 - max - min) : d / (max + min);
        switch (max) {
          case r: h = (g - b) / d + (g < b ? 6 : 0); break;
          case g: h = (b - r) / d + 2; break;
          case b: h = (r - g) / d + 4; break;
        }
        h /= 6;
      }
      return { h: h * 360, s: s * 100, l: l * 100 };
    }
  
    function hslToHex(h, s, l) {
      l /= 100;
      const a = s * Math.min(l, 1 - l) / 100;
      const f = n => {
        const k = (n + h / 30) % 12;
        const color = l - a * Math.max(Math.min(k - 3, 9 - k, 1), -1);
        return Math.round(255 * color).toString(16).padStart(2, '0');
      };
      return `#${f(0)}${f(8)}${f(4)}`;
    }
  
    let selectedParty = null;
    let selectedLevel = null;
  
    function initSwatches() {
      const toolbar = document.getElementById('toolbar');
      parties.forEach(party => {
        party.levels = generateShades(party.base);
        const swatchHTML = party.levels.map((color, i) =>
          `<div class="color-swatch" style="background:${color}" data-party="${party.id}" data-index="${i}"></div>`
        ).join('');
        const partyEl = document.createElement('div');
        partyEl.className = 'party-selector';
        partyEl.innerHTML = `
          <div style="margin-bottom:5px; font-weight:700;">${party.name}</div>
          <div class="swatches">${swatchHTML}</div>
        `;
        toolbar.appendChild(partyEl);
  
        partyEl.querySelectorAll('.color-swatch').forEach(swatch => {
          swatch.addEventListener('click', () => {
            const level = parseInt(swatch.dataset.index);
            selectSwatch(party.id, level);
          });
        });
      });
    }
  
    function selectSwatch(partyId, level) {
      const removeBtn = document.getElementById('remove-color');
      document.querySelectorAll('.color-swatch').forEach(s => s.classList.remove('selected'));
      removeBtn.classList.remove('selected');
      const swatch = document.querySelector(`.color-swatch[data-party="${partyId}"][data-index="${level}"]`);
      if (swatch) swatch.classList.add('selected');
      selectedParty = partyId;
      selectedLevel = level;
    }


function setupMap() {
  const tooltip = document.getElementById('tooltip');

  document.querySelectorAll('#regions path, #regions polygon, #regions polyline').forEach(region => {
    region.style.cursor = 'pointer';

    region.addEventListener('click', () => {
      if (selectedParty && selectedLevel !== null) {
        const party = parties.find(p => p.id === selectedParty);
        region.style.fill = party.levels[selectedLevel];
        region.setAttribute('data-party', selectedParty);
        region.setAttribute('data-level', selectedLevel);
        updateUncoloredRegionsList();
        updateLegend();
        updateURLState();
      } else {
        // remove fill
        region.style.fill = null;
        region.removeAttribute('data-party');
        region.removeAttribute('data-level');
        updateUncoloredRegionsList();
        updateLegend();
        updateURLState();
      }
    });

    region.addEventListener('mouseenter', e => {
  const regionName = region.id
    .replace(/^_+/, '')
    .replace(/_/g, ' ')
    .replace(/\b\w/g, c => c.toUpperCase());

  // Find nearest <g> ancestor that has an ID (excluding #regions)
  let parent = region.parentElement;
  let groupName = '';
  while (parent && parent.tagName !== 'svg') {
    if (parent.id && parent.id !== 'regions') {
      groupName = parent.id
        .replace(/^_+/, '')
        .replace(/_/g, ' ')
        .replace(/\b\w/g, c => c.toUpperCase());
      break;
    }
    parent = parent.parentElement;
  }

  tooltip.innerHTML = groupName ? `<span style="font-weight: 400;">${groupName}</span> <span style="font-weight: 700;">${regionName}</span>` : regionName;
  tooltip.style.opacity = 1;
});

    region.addEventListener('mousemove', e => {
      tooltip.style.left = `${e.pageX + 10}px`;
      tooltip.style.top = `${e.pageY + 10}px`;
    });

    region.addEventListener('mouseleave', () => {
      tooltip.style.opacity = 0;
    });
  });
}

function updateLegend() {
  const legendScroll = document.getElementById('legend');

  // Find used parties
  const usedPartyIds = new Set();
  document.querySelectorAll('#regions path, #regions polygon, #regions polyline').forEach(region => {
    const party = region.getAttribute('data-party');
    if (party) usedPartyIds.add(party);
  });

  const usedParties = parties.filter(p => usedPartyIds.has(p.id));

  legendScroll.innerHTML = usedParties.map(p => `
    <div class="legend-item">
      <div style="padding-bottom: 5px; font-weight: 600;">${p.name}</div>
      ${p.levels.map((color, i) => `
        <div><span class="legend-color" style="background:${color};"></span>${100-(i + 1)*10}</div>
      `).join('')}
    </div>
  `).join('');
}


    function setupRemoveButton() {
  const removeBtn = document.getElementById('remove-color');
  removeBtn.addEventListener('click', () => {
    // Just deselects any selected swatch
    selectedParty = null;
    selectedLevel = null;
    removeBtn.classList.add('selected');
    document.querySelectorAll('.color-swatch').forEach(s => s.classList.remove('selected'));
  });

    document.querySelectorAll('#regions path, #regions polygon, #regions polyline').forEach(region => {
        region.addEventListener('click', () => {
        if (selectedParty === null && selectedLevel === null) {
            region.style.fill = null;
            region.removeAttribute('data-party');
            region.removeAttribute('data-level');
            updateUncoloredRegionsList();
            updateLegend();
            updateURLState();
        }
        });
    });
    }
  
    function updateUncoloredRegionsList() {
  const uncoloredRegions = [];
  document.querySelectorAll('#regions path, #regions polygon, #regions polyline').forEach(region => {
    const fillColor = region.dataset.party;
    if (!fillColor || fillColor === '#b9b9b9' || fillColor === 'rgb(185, 185, 185)') { // Default color check
      // Get region name
      const regionName = region.id
        .replace(/^_+/, '')
        .replace(/_/g, ' ')
        .replace(/\b\w/g, c => c.toUpperCase());

      // Get parent group name
      let parent = region.parentElement;
      let groupName = '';
      while (parent && parent.tagName !== 'svg') {
        if (parent.id && parent.id !== 'regions') {
          groupName = parent.id
            .replace(/^_+/, '')
            .replace(/_/g, ' ')
            .replace(/\b\w/g, c => c.toUpperCase());
          break;
        }
        parent = parent.parentElement;
      }

      const displayName = groupName ? `<span style="font-weight: 400;">${groupName}</span> <span style="font-weight: 700;">${regionName}</span>` : regionName;
      uncoloredRegions.push(displayName);
    }
  });

  const listContainer = document.getElementById('uncolored-regions');
  listContainer.innerHTML = ''; // Clear existing list
  uncoloredRegions.forEach(name => {
    const listItem = document.createElement('span');
    listItem.style.paddingRight = '12px';
    listItem.style.cursor = 'pointer';
    listItem.style.transition = 'background 0.3s';
    listItem.style.fontSize = '14px';
    listItem.style.color = '#333';
    listItem.style.whiteSpace = 'nowrap';
    listItem.style.letterSpacing = '-0.04em';
    listItem.style.lineHeight = '1.6em';
    listItem.addEventListener('click', () => {
      const region = document.querySelector(`#regions #${name.replace(/<.*?>/g, '').replace(/\s+/g, '_')}`);
      if (region) {
        region.click(); // Trigger click event to color the region
      }
    });
    listItem.innerHTML = name;
    listContainer.appendChild(listItem);
  });
}



    function init() {
      initSwatches();
      setupMap();
      updateLegend();
      selectSwatch('party1', 2);
      setupRemoveButton();
      updateUncoloredRegionsList();
    }

const toolbar = document.getElementById('toolbar');
const scrollLeftBtn = document.getElementById('scroll-left');
const scrollRightBtn = document.getElementById('scroll-right');
    
    let isScrolling = false;

function scrollLegendBy(offset) {
  if (isScrolling) return;

  const container = document.getElementById('legend-scroll');
  isScrolling = true;

  container.scrollBy({ left: offset, behavior: 'smooth' });

  // Re-enable after scroll ends (approx 400ms)
  setTimeout(() => {
    isScrolling = false;
  }, 400);
}

    function downloadSVGAsPNG(scale = 2) {
  const svgElement = document.getElementById("map");
  const clone = svgElement.cloneNode(true);
  const viewBox = svgElement.viewBox.baseVal;

  // Set width and height explicitly on the clone
  const width = viewBox.width;
  const height = viewBox.height;
  clone.setAttribute("width", width);
  clone.setAttribute("height", height);

  const serializer = new XMLSerializer();
  const svgString = serializer.serializeToString(clone);

  const svgBlob = new Blob([svgString], { type: "image/svg+xml;charset=utf-8" });
  const url = URL.createObjectURL(svgBlob);

  const img = new Image();
  img.onload = function () {
    const canvas = document.createElement("canvas");
    canvas.width = width * scale;
    canvas.height = height * scale;

    const ctx = canvas.getContext("2d");
    ctx.setTransform(scale, 0, 0, scale, 0, 0); // Scale context
    ctx.drawImage(img, 0, 0);

    canvas.toBlob(function(blob) {
      const pngUrl = URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = pngUrl;
      link.download = "download.png";
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      URL.revokeObjectURL(pngUrl);
    }, "image/png");

    URL.revokeObjectURL(url);
  };
  img.src = url;
}

function updateMode(value) {
  modeContainer.innerHTML = ''; // remove existing
  modeContainer.innerHTML = (modeContent[value]());
}

    function updateURLState() {
  const coloredRegions = [...document.querySelectorAll('#regions path, #regions polygon, #regions polyline')]
    .filter(el => el.getAttribute('data-party'))
    .map(el => {
      const id = el.id;
      const party = parties.findIndex(p => p.id === el.getAttribute('data-party'));
      const level = el.getAttribute('data-level');
      return `${id}:${party}-${level}`;
    });

  const regionParam = `r=${coloredRegions.join(',')}`;
  const selectedParam = selectedParty !== null ? `s=${parties.findIndex(p => p.id === selectedParty)}-${selectedLevel}` : '';
  
  // Example: if using dropdown
  const dropdownParam = `d=${document.getElementById('mode-select').value}`;

  const params = [regionParam, selectedParam, dropdownParam].filter(Boolean).join('&');
  const newUrl = `${location.pathname}?${params}`;
  history.replaceState(null, '', newUrl);
}

function loadURLState() {
  const params = new URLSearchParams(window.location.search);

  // Restore dropdown if used
  const d = params.get('d');
  if (d !== null) {
      currentPresetIndex = d;
      document.getElementById('mode-select').value = d; // Your function for dropdown state
  }

  // Restore selected swatch
  const s = params.get('s');
  if (s) {
    const [partyIdx, level] = s.split('-').map(Number);
    if (!isNaN(partyIdx) && !isNaN(level)) {
      selectSwatch(parties[partyIdx].id, level);
    }
  }

  // Restore region fills
  const r = params.get('r');
  if (r) {
    r.split(',').forEach(pair => {
      const [id, val] = pair.split(':');
      const [partyIdx, level] = val.split('-').map(Number);
      const el = document.getElementById(id);
      if (el && parties[partyIdx] && parties[partyIdx].levels[level]) {
        el.style.fill = parties[partyIdx].levels[level];
        el.setAttribute('data-party', parties[partyIdx].id);
        el.setAttribute('data-level', level);
      }
    });
  }
}

document.getElementById('mode-select').addEventListener('change', e => {
  updateURLState();
  updateMode(e.target.value);
    setupMap();
  updateLegend();
  updateUncoloredRegionsList();
});

// Optional: initialize with default
loadURLState();
updateMode(document.getElementById('mode-select').value);
    init();
    loadURLState();
    updateLegend();
  </script>
